import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return (
    <div>
    <h2>{props.name}</h2>
    <img src={props.img} alt="avatar_img" />
    <p>{props.tel}</p>
    <p>{props.email}</p>
    </div>
  );

};
function Card1(props){
  return(
    <div>
      <h1>{props.name}</h1>
      <img src={props.img} alt="srk_img" />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>
  );
}

ReactDOM.render(
  <div>
    <h1>My Contacts</h1>

    <Card className="srk" name="Beyonce"
      img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
      tel="+123 456 789"
      email="b@beyonce.com"
    />
    <h1>My Contacts</h1>
    <Card1 name="Shah Rukh Khan"
     img="https://2.bp.blogspot.com/-Aw01PBC9OMY/UnNCQRfNd7I/AAAAAAAAArI/035JOMqNueQ/s1600/srk-473.jpg"
     tel="91589859856"
     email="srk0786@gmail.com"
    /> 
  </div>,
  document.getElementById("root")
);
